-- Les libellés sont ajoutés de manière dénormalisée (pas de table séparée
-- pour les libellés niveau 1 ce qui conduit à de la redondance)
-- pour limiter le nombre de jointures et améliorer la performance.
-- Il n'est pas attendu que les libellés changent.

-- Ajout des nouvelles colonnes
ALTER TABLE naf_codes
  ADD COLUMN niv1_libelle TEXT,
  ADD COLUMN niv5_libelle TEXT;

-- Création d'une table temporaire avec les données
CREATE TEMP TABLE import_libelles (
    niv1 VARCHAR(1),
    niv5 VARCHAR(10),
    niv1_libelle TEXT,
    niv5_libelle TEXT
);





-- Mise à jour de la table de passage
UPDATE naf_codes naf
SET
    niv1_libelle = lib.niv1_libelle,
    niv5_libelle = lib.niv5_libelle
FROM import_libelles lib
WHERE naf.niv5 = lib.niv5;

-- Nettoyage
DROP TABLE import_libelles;

---- create above / drop below ----

ALTER TABLE naf_codes
  DROP COLUMN IF EXISTS niv1_libelle,
  DROP COLUMN IF EXISTS niv5_libelle;
